snippet.textDisplay:
Trabalhava em uma padaria;
Apresentei um atestado de 14 dias por suspeita de covid, cumpri o atestado e quando voltei me mandaram embora, pode isso ? 
A padaria já havia afastado alguns funcionários de risco pra não mandar ninguém embora, pois, após a crise pegariam de volta com estabilidade, mas eu quando voltei do atestado fui demitido. A padaria tem um movimento super bom.

